import React from 'react';

class Agenda extends React.Component{

	render(){
		return(
			<div className='background'>
				<h1>Agenda</h1>
				<div className='foreground'>
					<div className='main-content'>
						<TimeHR time={'8:00 AM'}/>
					</div>
				</div>
			</div>
		);
	}

}

function TimeHR(props){
	return(
		<div>
			<hr/>
			<h5>{props.time}</h5>
		</div>
	);
}

export default Agenda;
